(322,'dbem_event_list_item_format','<div class=\"em-event em-item {is_cancelled}em-event-cancelled{/is_cancelled}\" style=\"--default-border:#_CATEGORYCOLOR;\">\r\n	<div class=\"em-item-image {no_image}has-placeholder{/no_image}\">\r\n		{has_image}\r\n		#_EVENTIMAGE{medium}\r\n		{/has_image}\r\n		{no_image}\r\n		<div class=\"em-item-image-placeholder\">\r\n			<div class=\"date\">\r\n				<span class=\"day\">#d</span>\r\n				<span class=\"month\">#M</span>\r\n			</div>\r\n		</div>\r\n		{/no_image}\r\n	</div>\r\n	<div class=\"em-item-info\">\r\n		<h3 class=\"em-item-title\">#_EVENTLINK</h3>\r\n		{is_cancelled}\r\n		<div class=\"em-event-cancelled em-notice em-notice-error em-notice-thin em-notice-icon\">\r\n			<span class=\"em-icon em-icon-cross-circle\"></span>\r\n			This event has been cancelled.		</div>\r\n		{/is_cancelled}\r\n		<div class=\"em-event-meta em-item-meta\">\r\n			<div class=\"em-item-meta-line em-event-date em-event-meta-datetime\">\r\n				<span class=\"em-icon-calendar em-icon\"></span>\r\n				#_EVENTDATES    \r\n			</div>\r\n			<div class=\"em-item-meta-line em-event-time em-event-meta-datetime\">\r\n				<span class=\"em-icon-clock em-icon\"></span>\r\n				#_EVENTTIMES\r\n			</div>\r\n			{bookings_open}\r\n			<div class=\"em-item-meta-line em-event-prices\">\r\n				<span class=\"em-icon-ticket em-icon\"></span>\r\n				#_EVENTPRICERANGE\r\n			</div>\r\n			{/bookings_open}\r\n			{has_location_venue}\r\n			<div class=\"em-item-meta-line em-event-location\">\r\n				<span class=\"em-icon-location em-icon\"></span>\r\n				#_LOCATIONLINK\r\n			</div>\r\n			{/has_location_venue}\r\n			{has_event_location}\r\n			<div class=\"em-item-meta-line em-event-location\">\r\n				<span class=\"em-icon-at em-icon\"></span>\r\n				#_EVENTLOCATION\r\n			</div>\r\n			{/has_event_location}\r\n			{has_category}\r\n			<div class=\"em-item-meta-line em-item-taxonomy em-event-categories\">\r\n				<span class=\"em-icon-category em-icon\"></span>\r\n				<div>#_EVENTCATEGORIES</div>\r\n			</div>\r\n			{/has_category}\r\n			{has_tag}\r\n			<div class=\"em-item-meta-line em-item-taxonomy em-event-tags\">\r\n				<span class=\"em-icon-tag em-icon\"></span>\r\n				<div>#_EVENTTAGS</div>\r\n			</div>\r\n			{/has_tag}\r\n		</div>\r\n		<div class=\"em-item-desc\">\r\n			#_EVENTEXCERPT{25}\r\n		</div>\r\n		<div class=\"em-item-actions input\">\r\n			<a class=\"em-item-read-more button\" href=\"#_EVENTURL\">More Info</a>\r\n			{bookings_open}\r\n			<a class=\"em-event-book-now button\" href=\"#_EVENTURL#em-event-booking-form\">\r\n				<span class=\"em-icon em-icon-ticket\"></span>\r\n				Book Now!			</a>\r\n			{/bookings_open}\r\n		</div>\r\n	</div>\r\n</div>','no'),
