INSERT INTO `wp_snippets` VALUES
(1,'Make upload filenames lowercase','Makes sure that image and file uploads have lowercase filenames.\n\nThis is a sample snippet. Feel free to use it, edit it, or remove it.','add_filter( \'sanitize_file_name\', \'mb_strtolower\' );','sample, media','global',10,0,'2023-11-26 00:23:24',2,NULL),
(2,'Disable admin bar','Turns off the WordPress admin bar for everyone except administrators.\n\nThis is a sample snippet. Feel free to use it, edit it, or remove it.','add_action( \'wp\', function () {\n	if ( ! current_user_can( \'manage_options\' ) ) {\n		show_admin_bar( false );\n	}\n} );','sample, admin-bar','front-end',10,1,'2023-11-26 00:23:24',2,NULL),
(3,'Allow smilies','Allows smiley conversion in obscure places.\n\nThis is a sample snippet. Feel free to use it, edit it, or remove it.','add_filter( \'widget_text\', \'convert_smilies\' );\nadd_filter( \'the_title\', \'convert_smilies\' );\nadd_filter( \'wp_title\', \'convert_smilies\' );\nadd_filter( \'get_bloginfo\', \'convert_smilies\' );','sample','global',10,0,'2023-11-26 00:23:24',2,NULL),
(4,'Current year','Shortcode for inserting the current year into a post or page..\n\nThis is a sample snippet. Feel free to use it, edit it, or remove it.','<?php echo date( \'Y\' ); ?>','sample, dates','content',10,0,'2023-11-26 00:23:24',2,NULL),
(5,'Redirect after login','','// Automatically redirect to user profile when logging in\nadd_filter( \'user_registration_login_redirect\', \'ur_redirect_after_login\', 10, 2 ); \nfunction ur_redirect_after_login( $redirect, $user ) { \n	return \'/members/\' . $user->display_name;\n}  ','','global',10,1,'2023-11-26 15:03:26',16,NULL),
(6,'Fix homepage activity listing buttons','<p>Need to add the activity-meta class to an element, since for some reason on the homepage it\'s half-missing.</p>','<script type=\"text/javascript\"> \n	jQuery(document).ready(function() {\n		jQuery(\".activity-content .-meta\").addClass(\"activity-meta\");\n	});\n</script>','','content',10,1,'2023-11-26 16:52:34',7,NULL);
